import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Welcome to ABC Consultancy</h1>
      <p>
        ABC Consultancy is a leading firm providing expert advice and solutions to help businesses grow and succeed.
        Our team of experienced consultants specializes in strategy, operations, technology, and management consulting.
      </p>
      <p>
        We are committed to delivering innovative and customized solutions that meet the unique needs of each client.
        Partner with us to transform your business and achieve your goals.
      </p>
    </div>
  );
};

export default Home;
